import React from 'react';
import logo from './logo.svg';
import './App.css';
import TodoList from './component/TodoList';

class App extends React.Component{
  constructor(){
    this.todoItems = [
      'Di mua bim bim',
      'Di da bong',
      'Di choi'
    ];
  }
  render(){
    return(
      <div className="App">
        {this.todoItems.map((item) => <TodoList title={item}/>)}
      </div>
    );
  }
}

export default App;
